import styled from 'styled-components'
import React from 'react'
import { Facebook, Instagram, Pinterest } from '@material-ui/icons'
import { requirePropFactory } from '@material-ui/core'

const Container = styled.div`
flex:1;
display:flex;

`
const Left = styled.div`
flex:1;
display:flex;
flex-direction:column;
padding:20px;
`
const Logo = styled.img`
width:100px;
height:100px;
margin-left:50px;`
const Desc = styled.div`
margin :30px 50px;`
const SocialContainer=styled.div`
margin-left:50px;
display:flex;`
const SocialIcon=styled.div`
width:40px;
height:40px;
border-radius:50%;
color:white;
background-color:#${props => props.color};
display:flex;
align-items:center;
justify-content:center;
margin-right:20px;`
const Center = styled.div`
flex:1;
padding:20px;
`
const Title=styled.h3`
margin-bottom:30px;`
const List = styled.ul`
margin:0;
padding:0;
list-style:none;

flex-wrap:wrap;`
const ListItem = styled.li`
width:50%;`
const Right = styled.div`
flex:1;
padding:20px;
`
const Footer=()=> {
    return (
        <Container>
            <Left><Logo src={require('../../image/NaturalWOODLOgo.PNG').default}>

            </Logo>
            <Desc>Contact With Us.</Desc>
            <SocialContainer>
                <SocialIcon color = "3B5999">
                    <Facebook/>
                </SocialIcon>
                <SocialIcon color="E4405f">
                   <Instagram/>
                </SocialIcon>
                <SocialIcon color= "E60023">
                  <Pinterest/>
                </SocialIcon>
                </SocialContainer></Left>
            <Center>
                <Title>UseFull List</Title>
                <List><ListItem>Home</ListItem>
                <ListItem>Cart</ListItem>
                <ListItem>Products</ListItem>
                <ListItem>MyAccount</ListItem>
                <ListItem>Order Tracking</ListItem>
               </List>
            </Center>
            <Right></Right>
        </Container>
      
    )
}
export default Footer;
